const DobavljacDetalji = ({ dobavljac }) => {

    return (
      <div className="workout-details">
        <h4>{dobavljac.id}</h4>
        <p><strong>Nzaiv: </strong>{dobavljac.naziv}</p>
        <p><strong>Jib: </strong>{dobavljac.jib}</p>
        <p>{dobavljac.createdAt}</p>
      </div>
    )
  }
  export default DobavljacDetalji
